// src/components/NextPage.js
import React from 'react';

const NextPage = () => {
  return (
    <div>
      <h2>Добро пожаловать на следующую страницу!</h2>
      <p>Это страница номер 2. Продолжайте исследовать наш магазин!</p>
    </div>
  );
};

export default NextPage;
